import{_ as r}from"./plugin-vue_export-helper.21dcd24c.js";import{o as a,c as n,a as t,b as s,e as d,d as o,r as i}from"./app.28cf9551.js";const h={},l=d('<h1 id="readme" tabindex="-1"><a class="header-anchor" href="#readme" aria-hidden="true">#</a> README</h1><p>[TOC]</p><h1 id="readme-1" tabindex="-1"><a class="header-anchor" href="#readme-1" aria-hidden="true">#</a> README</h1><h2 id="\u4F5C\u7528" tabindex="-1"><a class="header-anchor" href="#\u4F5C\u7528" aria-hidden="true">#</a> \u4F5C\u7528</h2><p>\u8BB0\u5F55\u5B66\u4E60\u8FC7\u7A0B\u4E2D\u9047\u5230\u7684\u6280\u5DE7\uFF0C\u504F\u5411\u4E8E\u5BF9\u5404\u7C7B\u5DE5\u5177\u8F6F\u4EF6\u7684\u4F7F\u7528\uFF0C\u6BD4\u5982 matlab \u4EE3\u7801\u6280\u5DE7\uFF0C\u5B89\u88C5\u914D\u7F6E\u8F6F\u4EF6\u7684\u65B9\u6CD5\u7B49\u3002</p><h2 id="\u89C4\u5219" tabindex="-1"><a class="header-anchor" href="#\u89C4\u5219" aria-hidden="true">#</a> \u89C4\u5219</h2><p>\u672C skill \u77E5\u8BC6\u5E93\u76EE\u7684\u662F\u6574\u5408\u591A\u79CD\u64CD\u4F5C\u6307\u5357\uFF0C\u9762\u5411\u7684\u662F\u5E94\u7528\u5C42\u9762\uFF0C\u548C library \u7684\u7406\u8BBA\u6307\u5357\u76F8\u5BF9\u3002\u4E0B\u9762\u7B80\u8FF0\u90E8\u5206\u7684\u901A\u7528\u6587\u7AE0\u3002</p><hr><h3 id="\u524D\u7F6E\u77E5\u8BC6" tabindex="-1"><a class="header-anchor" href="#\u524D\u7F6E\u77E5\u8BC6" aria-hidden="true">#</a> \u524D\u7F6E\u77E5\u8BC6</h3><p>\u9996\u5148\uFF0C<strong>\u5E94\u7ED9\u4E00\u4E2A\u7B80\u4ECB</strong>\uFF0C\u8BF4\u660E\u6307\u5357\u7684\u76EE\u7684\u3001\u662F\u9488\u5BF9\u4EC0\u4E48\uFF08\u5982\u4EA7\u54C1\u3001\u578B\u53F7\uFF09\u7684\u6307\u5357\u3002\u6838\u5FC3\u539F\u5219\u662F<mark>sell knowledge to future</mark>\uFF0C\u8BA9\u672A\u6765\u7684\u6211\u80FD\u6709\u5174\u8DA3\u8BFB\u4E0B\u53BB\u3002</p><p>\u63A5\u4E0B\u6765\uFF0C<strong>\u4EA4\u4EE3\u4E8B\u5148\u9700\u8981\u51C6\u5907\u4EC0\u4E48</strong>\u3002\u4F8B\u5982\uFF0C\u7ED9\u51FA\u9700\u8981\u51C6\u5907\u7684\u8F85\u52A9\u5DE5\u5177\uFF08\u5982\u9884\u88C5\u4EC0\u4E48\u8F6F\u4EF6\u3001\u4EC0\u4E48\u578B\u53F7\u7684\u6539\u9525\uFF09\u3002\u5982\u679C\u5B8C\u6210\u64CD\u4F5C\u6709\u573A\u5730\u3001\u5929\u6C14\u3001\u73AF\u5883\u3001\u914D\u7F6E\uFF08\u5982\u7535\u8111\u914D\u7F6E\uFF09\u6216\u5176\u5B83\u56E0\u7D20\u7684\u5F71\u54CD\uFF0C\u9700\u8981\u660E\u786E\u4EA4\u4EE3\u3002</p><h3 id="\u6307\u5357\u6B65\u9AA4" tabindex="-1"><a class="header-anchor" href="#\u6307\u5357\u6B65\u9AA4" aria-hidden="true">#</a> \u6307\u5357\u6B65\u9AA4</h3><ol><li><p><strong>\u7ED9\u7269\u4EF6\u6E05\u5355\u7F16\u53F7</strong>\u3002\u5982\u679C\u4EFB\u52A1\u5305\u542B\u4E00\u5B9A\u6570\u91CF\u7684\u7269\u54C1\u6216\u6750\u6599\uFF0C\u9700\u8981\u5728\u5217\u51FA\u6E05\u5355\u65F6\u7F16\u53F7\uFF0C\u4EE5\u4FBF\u80FD\u76F4\u89C2\u4E86\u89E3\u7269\u4EF6\u7684\u6570\u76EE\uFF0C\u4E14\u5728\u63D0\u5230\u65F6\u6309\u7F16\u53F7\u5F15\u7528\u53EF\u80FD\u66F4\u6E05\u6670\u3002</p></li><li><p><strong>\u7ED9\u914D\u56FE\u5178\u578B\u4F4D\u7F6E\u6807\u6CE8\u5FC5\u8981\u7684\u6807\u7B7E</strong>\u3002\u4E00\u4E9B\u6B65\u9AA4\u53EF\u80FD\u9700\u8981\u914D\u56FE\u3002\u5728\u914D\u56FE\u4E2D\uFF0C\u7ED9\u64CD\u4F5C\u6D41\u7A0B\u4E2D\u9700\u8981\u7528\u5230\u7684\u90E8\u4F4D\u6807\u8BB0\u6807\u7B7E\uFF08\u5F80\u5F80\u662F\u67D0\u79CD\u683C\u5F0F\u7684\u7F16\u53F7\uFF09\uFF0C\u4FBF\u4E8E\u6307\u4EE3\u65F6\u5B9A\u4F4D</p></li><li><p><strong>\u5404\u6B65\u9AA4\u7684\u987A\u5E8F\u4E0D\u80FD\u641E\u9519</strong>\u3002\u4E00\u822C\u9700\u8981\u91C7\u53D6\u627F\u524D\u542F\u540E\u7684\u6392\u5E8F\u539F\u5219\uFF0C\u5927\u591A\u6570\u60C5\u51B5\u4E0B\u662F\u6309\u65F6\u95F4\u987A\u5E8F\u64CD\u4F5C\u3002\u5982\u679C\u4E0D\u540C\u6B65\u9AA4\u4E4B\u95F4\u5B58\u5728\u5FAA\u73AF\uFF0C\u90A3\u4E48\u9700\u8981\u753B\u51FA\u6E05\u6670\u7684\u6D41\u7A0B\u56FE\uFF0C\u7528\u7BAD\u5934\u6307\u660E\u64CD\u4F5C\u65B9\u5411\u3002\u5982\u679C\u67D0\u4E9B\u6B65\u9AA4\u53EF\u4EE5\u4E0D\u533A\u5206\u5148\u540E\uFF0C\u5219\u53EF\u4EE5\u6309\u4ECE\u7B80\u5355\u5230\u590D\u6742\u7684\u987A\u5E8F\u6392\u5217\u3002</p></li><li><p><strong>\u660E\u786E\u6BCF\u4E00\u6B65\u9AA4\u7684\u8D77\u70B9\u3001\u4E2D\u95F4\u548C\u7EC8\u70B9</strong>\u3002\u6307\u51FA\u5F00\u59CB\u65F6\u8981\u51C6\u5907\u4EC0\u4E48\uFF08\u5FC5\u8981\u65F6\u6307\u51FA\u4E0E\u4E0A\u4E00\u6B65\u9AA4\u7684\u5173\u7CFB\uFF09\u3001\u4E2D\u95F4\u9700\u8981\u5B8C\u6210\u4EC0\u4E48\u3001\u6700\u540E\u5C06\u5F97\u5230\u4EC0\u4E48\uFF0C\u524D\u540E\u903B\u8F91\u6E05\u695A\u3002\u5982\u679C\u4E00\u4E2A\u5177\u4F53\u7684\u64CD\u4F5C\u6B65\u9AA4\u6D89\u53CA\u5230\u65F6\u95F4\u7684\u957F\u77ED\uFF0C\u90A3\u4E48\u9700\u8981\u7ED9\u51FA\u65F6\u95F4\uFF08\u4F8B\u5982\uFF0C\u4E00\u4E2A\u6837\u54C1\u9700\u8981\u6652\u591A\u957F\u65F6\u95F4\uFF09\u3002\u5982\u679C\u4E00\u4E2A\u8282\u70B9\u6B63\u786E\u5B8C\u6210\u4F1A\u51FA\u73B0\u67D0\u7279\u5F81\uFF08\u5982\u989C\u8272\uFF09\uFF0C\u90A3\u4E48\u7ED9\u51FA\u56FE\u7247\u8BF4\u660E\u8FBE\u5230\u9884\u60F3\u7684\u7279\u5F81\u662F\u4EC0\u4E48\uFF08\u4F8B\u5982\uFF0C\u505A\u7EA2\u70E7\u8089\u65F6\uFF0C\u5B8C\u6210\u4E00\u4E2A\u8282\u70B9\u540E\uFF0C\u8089\u7684\u989C\u8272\u5E94\u8BE5\u662F\u4EC0\u4E48\uFF0C\u5C31\u7ED9\u51FA\u4E00\u4E2A\u56FE\u7247\uFF09</p></li><li><p><strong>\u5FC5\u8981\u65F6\u6307\u660E\u6210\u529F\u4E0E\u5931\u8D25</strong>\u3002\u5982\u679C\u67D0\u4E9B\u6B65\u9AA4\uFF0C\u6216\u8005\u67D0\u6B65\u9AA4\u7684\u67D0\u8282\u70B9\u5B58\u5728\u6210\u529F\u4E0E\u5931\u8D25\uFF08\u6216\u8005\u8D28\u91CF\u8FBE\u4E0D\u5230\u8981\u6C42\uFF09\u7684\u53EF\u80FD\u6027\uFF0C\u90A3\u4E48\u9700\u8981\u6307\u660E\u4EC0\u4E48\u662F\u6210\u529F\u6216\u8005\u4EC0\u4E48\u662F\u5931\u8D25\uFF08\u4F8B\u5982\uFF0C\u51FA\u73B0\u4EC0\u4E48\u989C\u8272\u5C31\u7B97\u6210\u529F\uFF0C\u51FA\u73B0\u4EC0\u4E48\u989C\u8272\u5C31\u7B97\u5931\u8D25\uFF09\u3002</p></li><li><p><strong>\u6709\u5371\u9669\u7684\u6B65\u9AA4\u9700\u8981\u91CD\u70B9\u5F3A\u8C03\u6709\u4F55\u5371\u9669</strong>\u3002\u8FD9\u91CC\u6240\u6307\u7684\u5371\u9669\uFF0C\u5E76\u4E0D\u4E00\u5B9A\u662F\u6307\u5E26\u6765\u4EBA\u8EAB\u4F24\u5BB3\uFF0C\u4E5F\u53EF\u80FD\u662F\u6307\u4E00\u4E0D\u5C0F\u5FC3\uFF0C\u4F1A\u5BFC\u81F4\u6574\u4E2A\u64CD\u4F5C\u5D29\u6E83\u3002\u5982\u679C\u8FD9\u4E00\u6B65\u9AA4\uFF0C\u6216\u4E2D\u95F4\u67D0\u4E2A\u8282\u70B9\uFF0C\u64CD\u4F5C\u6709\u4EC0\u4E48\u4E0D\u5230\u4F4D\u5C31\u4F1A\u5BFC\u81F4\u6574\u4F53\u5D29\u6E83\u6216\u8005\u5176\u5B83\u5371\u9669\uFF0C\u5219\u9700\u8981\u5F3A\u8C03\u3002</p></li><li><p><strong>\u5982\u679C\u9700\u8981\u53C2\u8003\u5176\u5B83\u8D44\u6E90\uFF0C\u5219\u53EF\u4EE5\u901A\u8FC7\u4E8C\u7EF4\u7801\u7B49\u5F62\u5F0F\u7ED9\u51FA\u83B7\u53D6\u9014\u5F84</strong>\u3002\u4F8B\u5982\uFF0C\u5982\u679C\u67D0\u64CD\u4F5C\u5FC5\u987B\u6709\u89C6\u9891\u6307\u5F15\uFF0C\u90A3\u4E48\u53EF\u4EE5\u901A\u8FC7\u4E8C\u7EF4\u7801\u94FE\u63A5\u5230\u89C6\u9891\u3002</p></li></ol><p>\u65E0\u8BBA\u54EA\u90E8\u5206\uFF0C\u9700\u8981\u4F7F\u7528 <strong>\u901A\u4FD7\u6613\u61C2\u7684\u8BED\u8A00</strong>\uFF0C\u4E3B\u52A8\u8BED\u6C14\uFF08\u50CF\u547D\u4EE4\u4E00\u6837\uFF0C\u8868\u793A\u5FC5\u987B\u90A3\u6837\u505A\uFF09\u3002\u793A\u610F\u56FE\u548C\u6807\u6CE8\u4E0D\u591A\u4E0D\u5C11\u3002<strong>\u56FE\u7247\u548C\u6807\u6CE8\u770B\u5F97\u6E05\uFF0C\u6392\u5217\u903B\u8F91</strong>\u3002\u5FC5\u8981\u65F6\uFF0C\u5B9E\u7269\u56FE\u7247\u548C\u793A\u610F\u56FE\u914D\u5408\u4F7F\u7528\u3002\u6587\u5B57\u63CF\u8FF0\u65E2\u6E05\u695A\u53C8\u4E0D\u5570\u55E6\uFF0C\u53EF\u4EE5\u8BD5\u63A2\u5C11\u4E86\u4E00\u53E5\u8BDD\u4F1A\u600E\u6837\u3001\u591A\u4E86\u4E00\u53E5\u4F1A\u600E\u6837\u3002</p><p>\u5199\u5B8C\u521D\u7A3F\u540E\uFF0C<strong>\u9996\u5148\u5E94\u8BE5\u81EA\u5DF1\u7167\u7740\u6307\u5357\u4F7F\u7528</strong>\uFF0C\u770B\u770B\u4E25\u683C\u6309\u6B65\u9AA4\u662F\u5426\u80FD\u5B8C\u6210\u6B63\u786E\u64CD\u4F5C\u3002\u63A5\u4E0B\u6765\uFF0C**\u9080\u8BF7*<em>\u591A\u540D*<em>\u5B8C\u5168\u6CA1\u6709\u4F7F\u7528\u8FC7\u7684\u8BD5\u7528\u8005\uFF0C\u7167\u7740\u521D\u7A3F\u5B8C\u6210\u64CD\u4F5C\uFF0C\u63D0\u5EFA\u8BAE</em></em>\u3002\u5982\u679C\u8BD5\u7528\u8005\u65E0\u6CD5\u6B63\u786E\u5B8C\u6210\u64CD\u4F5C\uFF0C\u5219\u8BF4\u660E\u6307\u5357\u6CA1\u6709\u8FBE\u5230\u8981\u6C42\u3002\u4E0D\u65AD\u4FEE\u6539\uFF0C\u76F4\u5230\u8BD5\u7528\u8005\u80FD\u51C6\u786E\u3001\u65E0\u8BEF\u3001\u9AD8\u6548\u5B8C\u6210\u64CD\u4F5C\u3002</p><p>\u6700\u540E\uFF0C<strong>\u6743\u8861\u64CD\u4F5C\u6307\u5357\u7684\u957F\u77ED</strong>\u3002\u6709\u7684\u662F\u9488\u5BF9\u4E00\u4E2A\u7B80\u5355\u7684\u64CD\u4F5C\uFF0C\u5982\u4E00\u4E2A\u7B80\u6613\u7269\u54C1\u7684\u5B89\u88C5\uFF0C\u90A3\u4E48\u64CD\u4F5C\u6307\u5357\u5E94\u5C3D\u53EF\u80FD\u7B80\u77ED\u3002\u6709\u7684\u5C5E\u4E8E\u6280\u80FD\u578B\u64CD\u4F5C\u6307\u5357\uFF0C\u5982\u4E00\u4E2A\u590D\u6742\u7684\u5B9E\u9A8C\u6216\u8F6F\u4EF6\u4F7F\u7528\u7684\u64CD\u4F5C\u6D41\u7A0B\u3001\u5236\u4F5C\u4E00\u4E2A\u4EA7\u54C1\uFF0C\u90A3\u4E48\u53EF\u80FD\u8981\u6C42\u5199\u5F97\u5F88\u957F\u3002</p><table><thead><tr><th>hell0</th><th>asa</th><th>asas</th></tr></thead><tbody><tr><td>as</td><td>as</td><td>asaass</td></tr><tr><td>as</td><td>*\uFE0F\u20E3</td><td>as</td></tr><tr><td>as</td><td>as</td><td>==</td></tr></tbody></table><h2 id="\u53C2\u8003" tabindex="-1"><a class="header-anchor" href="#\u53C2\u8003" aria-hidden="true">#</a> \u53C2\u8003</h2>',18),c={href:"https://mp.weixin.qq.com/s/VKK1lAkZjN7fczg9r-wsAw",target:"_blank",rel:"noopener noreferrer"},p=o("\u5982\u4F55\u5199\u64CD\u4F5C\u6307\u5357 (qq.com)");function g(m,_){const e=i("ExternalLinkIcon");return a(),n("div",null,[l,t("ul",null,[t("li",null,[t("a",c,[p,s(e)])])])])}var x=r(h,[["render",g],["__file","index.html.vue"]]);export{x as default};
